const RecipeList = ({ food }) => {
  console.log("title:", food);
  return (
    <div className="RecipeList">
      <table>
        <td>
          <tr> {food.title}</tr>
        </td>
        <td>
          <tr> {food.title}</tr>
        </td>
        <td>
          <tr> {food.time}</tr>
        </td>
      </table>
    </div>
  );
};

export default RecipeList;
